Права на российский сериал выкупил американский стриминговый сервис Netflix. “Эпидемия” будет переведена на 12 языков. Об этом на свой странице в Facebook сообщил продюсер проекта Валерий Федорович.

В иностранном прокате сериал по дебютному роману Яны Вагнер режиссера Павла Костомарова будет звучать как The lake (прим. ред. Озеро). 

Роман Яны Вагнер “Вонгозеро”, вышедший в 2011 году лег в основу сценария научно-фантастического сериала с элементами драмы и триллера.

Неизвестная болезнь косит москвичей. У зараженных начинается кашель, обесцвечиваются глаза, а через 3-4 дня наступает смерть. Как лечить инфекцию никто не знает. Город закрывают на карантин. Тем временем жители мрут, как мухи, а СМИ нагнетают панику. Выжившие вынуждены бороться за ресурсы. Внутри всего этого хаоса разворачивается настоящая драма. Главный герой, Сергей, вынужден принимать непростые решения, спасая из опустевшего города бывшую жену с сыном и свою новую любовь с ребенком-аутистом. Неожиданно к группе присоединяются отец Сергея, у которого связывают с героем непростые отношения, и соседи со своими скелетами в шкафу. Компания ставит перед собой цель – добраться до озера в Карелии и переждать кризис в убежище на необитаемом острове.

Премьера сериала “Эпидемия” состоялась в ноябре 2019 года. Проект состоит из 8 эпизодов, по 45 минут каждый. Показ завершился в январе 2020-го.

Главные роли исполняют Кирилл Кяро, Александр Робак, Юрий Кузнецов, Марьяна Спивак, Анна Михалкова Виктория Исакова.

2 сентября 2020 года, в среду, в холдинге “Национальная Медиа группа” заявила о партнерстве с Netfilx. НМГ становится официальным оператором стримингового сервиса в России, сообщает ТАСС.

